import React from "react";
import { Outlet } from "react-router-dom";

export default function Layout() {
  return (
    <div>
      <div
        style={{
          backgroundColor: "#172D37",
          width: "100%",
          padding: 20,
          color: "#fff",
        }}
      >
        <button>Home</button>
        <button>Login</button>
      </div>
      <Outlet />
    </div>
  );
}
